import React, {Component} from 'react';

class Blog1 extends Component {
         state = {
            id: null
        }

    componentDidMount() {
        let id = this.props.match.params.blog_i;
        this.setState({
            id: id
        })
    }
    
    render() {
        return (
            <div className="blogs">
                <h1>Why do we wake up early?</h1>
            </div>
        );
    }
}

export default Blog1;
